css:
@-moz-document url-prefix("https://www.jetbrains.com/help/") {
:root {
	--brd1: #3b7983;
    --brd2: #0c4756;
    --bg5 : #001725;
    --bg6 : #385577;
    --red2: #ff5757;
    --red3: #e11515;   
    --red4: #400006;
    
    --bkg1:#123;    
    --bkg2:#124;
    --bkg3:#fff176;
    --hdr1:#8dcbf1;    
    --hdr2:#3bffdb;
    --hov1:#fffd17;        
    --hov2:#E91E63;    
    --red_2: #ff5757;
    --h1:#fffd17;
    --h2:#4db774;
    --h3:#8c4db7;   
    
}

h1 {color: #fffd17!important; }
h2 {color: #4db774!important; }
h3 {color: #8c4db7!important; }

.app__header, .header { background: #123; color: #8dcbf1;}
.dropdown__trigger { color:#3bffdb}
.dropdown__trigger:hover {	color: #fffd17;}

.app__nav { background: #123; }
a.toc-item {color: #3bffdb;}
.toc-item:hover {background: #E91E63; color: #fffd17; }

.layout.layout--rows.layout--scroll-container.layout--grow
{ background: #124; color: #8dcbf1;}

.prompt__wrapper {	font-weight: bold;	background: #fff176; color: #E91E63 !important;}

.code, .filepath, table._layout-fixed {	color: #ff5757;	font-style: italic; }

.article, .article dt {	color: #fff176; }

kbd, .kbd {	background: #009688; color: #fffd17; }

thead {	color: #fffd17;}


.app__main {background: #04101e;}
.wt-button_mode_nude {color: #ff5757}
.app__footer {   background: #04101e; 	color: #3bffdb;}
.footer__copyright { 	color: #8dcbf1; }
}
